import React from "react";
import { StyleSheet,View,Text } from "react-native";
import { SafeAreaView } from "react-native-safe-area-context";

const Cart = () =>{
    return(
        <SafeAreaView>
            <Text>Cart</Text>
        </SafeAreaView>
    )
}

export default Cart
